import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; // Import React Router
import CreateTrigger from './components/CreateTrigger'; // Import the CreateTrigger component

const TriggerDemo = () => {
    return (
        <Router>
            <div>
                <h1>ParcoRTLS Trigger Management</h1>
                <Switch>
                    <Route exact path="/" component={CreateTrigger} />
                    {/* You can add more routes here if needed */}
                </Switch>
            </div>
        </Router>
    );
};

export default TriggerDemo;
